import { MDBContainer } from 'mdbreact';
import React, { Component } from 'react';
import HeaderNotLogin from '../../../components/user/HeaderNotLogin';
import SlideProduct from '../../../components/user/SlideProduct';
import Carousel from './Carousel';

class Home extends Component {
    render() {
        return (
            <div>
                <header>
                    <HeaderNotLogin />
                    <Carousel />
                </header>
                <main>
                    <MDBContainer>
                        <SlideProduct/>
                    </MDBContainer>
                </main>
            </div>
        );
    }
}

export default Home;
